    <script>
    var _rollbarConfig = {
    accessToken: "cf418960a0ae4c00a1eeec43ae7500c8",
    enabled: "%NODE_ENV%" === "production",
    captureUncaught: true,
    captureUnhandledRejections: true,
    verbose: true, // This will now log to console.log, as well as Rollbar
    hostBlackList: [
        "127.0.0.1",
        "localhost",
        "192.168.99.1",
        "192.168.99.100",
        "minikube.data.gov.au"
    ], // exclude local dev
    payload: {
        environment: "production",
        client: {
            javascript: {
                source_map_enabled: true, //this is now true by default
                code_version: "%REACT_APP_SHA1%",
                // Optionally have Rollbar guess which frames the error was thrown from
                // when the browser does not provide line and column numbers.
                guess_uncaught_frames: true
            }
        }
    }
};
</script>
